  private fun zzUnpackAttribute(packed: String , offset: Int, result: IntArray): Int {
    var i: Int = 0;       /* index in packed string  */
    var j: Int = offset;  /* index in unpacked array */
    var l: Int = packed.length;
    while (i < l) {
      var count: Int = packed[i++].code;
      var value: Int = packed[i++].code;
      do
          result[j++] = value
      while (--count > 0)
    }
    return j;
  }

  private val ZZ_ATTRIBUTE: IntArray = zzUnpackAttribute()

  /**
   * Translates raw input code points to DFA table row
   */
  private fun zzCMap(input: Int): Int {
    var offset: Int = input and 255;
    return if(offset == input) ZZ_CMAP_BLOCKS[offset] else ZZ_CMAP_BLOCKS[ZZ_CMAP_TOP[input shr 8] or offset];
  }

  private fun zzScanError(errorCode: Int) {
    var message = try {
      ZZ_ERROR_MSG[errorCode];
    } catch (e: ArrayIndexOutOfBoundsException) {
      ZZ_ERROR_MSG[ZZ_UNKNOWN_ERROR];
    }

    throw Error(message);
  }
  /**
   * Converts an int token code into the name of the
   * token by reflection on the cup symbol class/interface sym
   */
  private fun getTokenName(token: Int): String {
    try {
       var classFields: Array<java.lang.reflect.Field> = sym::class.java.fields
      for (i in classFields.indices) {
        if (classFields[i].getInt(null) == token) {
          return classFields[i].name
        }
      }
    } catch (e: Exception) {
      e.printStackTrace(System.err);
    }

    return "UNKNOWN TOKEN";
  }

  /**
   * Runs the scanner on input files.
   *
   * This main method is the debugging routine for the scanner.
   * It prints debugging information about each returned token to
   * System.out until the end of file is reached, or an error occured.
   *
   * @param argv   the command line, contains the filenames to run
   *               the scanner on.
   */
  public fun main(argv: Array<String>) {
    if (argv.isEmpty()) {
      println("Usage : java MyScan [ --encoding <name> ] <inputfile(s)>");
    }
    else {
      var firstFilePos = 0;
      var encodingName = "UTF-8";
      if (argv[0].equals("--encoding")) {
        firstFilePos = 2;
        encodingName = argv[1];
        try {
          // Side-effect: is encodingName valid?
          java.nio.charset.Charset.forName(encodingName);
        } catch (e: Exception) {
          println("Invalid encoding '" + encodingName + "'");
          return;
        }
      }
      for (i in firstFilePos..<argv.size) {
        var scanner: MyScan? = null
        var stream: Source? = null
        try {
          stream = SystemFileSystem.source(Path(argv[i])).buffered()
          scanner = MyScan(stream);
          while ( !scanner.zzAtEOF ) scanner.debug_next_token();
        }
        catch (e: java.io.FileNotFoundException) {
          println("File not found : \""+argv[i]+"\"");
        }
        catch (e: java.io.IOException) {
          println("IO error scanning file \""+argv[i]+"\"");
          println(e);
        }
        catch (e: Exception) {
          println("Unexpected exception:");
          e.printStackTrace();
        }
        finally {
          if (stream != null) {
            try {
              stream.close();
            }
            catch (e: java.io.IOException) {
              println("IO error closing file \""+argv[i]+"\"");
              println(e);
            }
          }
        }
      }
    }
  }

