  /**
   * Creates a new scanner
   *
   * @param   in  the java.io.Reader to read input from.
   */
  constructor (input: Source) {
    states.insert("YYINITIAL", true);
    this.zzReader = input;
  }


  /** Returns the maximum size of the scanner buffer, which limits the size of tokens. */
  private fun zzMaxBufferLen(): Int {
    return Integer.MAX_VALUE;
  }

  /**  Whether the scanner buffer can grow to accommodate a larger token. */
  private fun zzCanGrow(): Boolean {
    return true;
  }



  /**
   * Refills the input buffer.
   *
   * @return      <code>false</code>, iff there was new input.
   *
   * @exception   java.io.IOException  if any I/O-Error occurs
   */
  @Throws(java.io.IOException::class)
  private fun zzRefill(): Boolean {

    /* first: make room (if you can) */
    if (zzStartRead > 0) {
      zzEndRead += zzFinalHighSurrogate;
      zzFinalHighSurrogate = 0;
      System.arraycopy(
        zzBuffer, zzStartRead,
        zzBuffer, 0,
        zzEndRead - zzStartRead
      );

      /* translate stored positions */
      zzEndRead -= zzStartRead;
      zzCurrentPos -= zzStartRead;
      zzMarkedPos -= zzStartRead;
      zzStartRead = 0;
    }

    /* is the buffer big enough? */
    if (zzCurrentPos >= zzBuffer.size - zzFinalHighSurrogate && zzCanGrow()) {
      /* if not, and it can grow: blow it up */
      var newBuffer: CharArray = CharArray(Math.min(zzBuffer.size * 2, zzMaxBufferLen()));
      System.arraycopy(zzBuffer, 0, newBuffer, 0, zzBuffer.size);
      zzBuffer = newBuffer;
      zzEndRead += zzFinalHighSurrogate;
      zzFinalHighSurrogate = 0;
    }

    /* fill the buffer with new input */
    var requested: Int = zzBuffer.size - zzEndRead;
    var numRead = 0
    for (i in 0..<requested) {
      if (zzReader.exhausted()) {
        numRead = -1
        break
      }
      zzBuffer[zzEndRead + i] = zzReader.readCodePointValue().toChar()
      numRead++
    }

    /* not supposed to occur according to specification of Source */
    if (numRead == 0) {
      if (requested == 0) {
        throw java.io.EOFException("Scan buffer limit reached [" + zzBuffer.size + "]");
      } else {
        throw java.io.IOException(
          "Reader returned 0 characters. See JFlex examples/zero-reader for a workaround."
        );
      }
    }
    if (numRead > 0) {
      zzEndRead += numRead;
      if (Character.isHighSurrogate(zzBuffer[zzEndRead - 1])) {
        if (numRead == requested) { // We requested too few chars to encode a full Unicode character
          --zzEndRead;
          zzFinalHighSurrogate = 1;
        } else {          // There is room in the buffer for at least one more char
          var c: Int = zzReader.readInt();  // Expecting to read a paired low surrogate char
          if (c == -1) {
            return true;
          } else {
            zzBuffer[zzEndRead++] = c.toChar();
          }
        }
      }
      /* potentially more input available */
      return false;
    }

    /* numRead < 0 ==> end of stream */
    return true;
  }

  /**
   * Closes the input reader.
   *
   * @throws java.io.IOException if the reader could not be closed.
   */
  @Throws(java.io.IOException::class)
  fun yyclose() {
    zzAtEOF = true; // indicate end of file
    zzEndRead = zzStartRead; // invalidate buffer

    if (zzReader != null) {
      zzReader.close();
    }
  }


  /**
   * Stores the current input stream on a stack, and
   * reads from a new stream. Lexical state, line,
   * char, and column counting remain untouched.
   *
   * The current input stream can be restored with
   * yypopStream (usually in an {@code <<EOF>>} action).
   *
   * @param reader the new input stream to read from
   *
   * @see #yypopStream()
   */
  fun yypushStream(reader: Source) {
    zzStreams.push(
        ZzFlexStreamInfo(zzReader, zzEndRead, zzStartRead, zzCurrentPos,
            zzMarkedPos, yyline, yychar, yycolumn, zzBuffer, zzAtBOL, zzAtEOF, zzEOFDone,
            zzFinalHighSurrogate)
    );
    zzBuffer = CharArray(Math.min(ZZ_BUFFERSIZE, zzMaxBufferLen()));
    zzReader = reader;
    yyResetPosition();
  }


  /**
   * Closes the current input stream and continues to
   * read from the one on top of the stream stack.
   *
   * @throws java.util.NoSuchElementException
   *         if there is no further stream to read from.
   *
   * @throws java.io.IOException
   *         if there was an error in closing the stream.
   *
   * @see #yypushStream(Source)
   */
  @Throws(java.io.IOException::class)
  fun yypopStream() {
    zzReader.close();
    var s: ZzFlexStreamInfo  = zzStreams.pop();
    zzBuffer      = s.zzBuffer;
    zzReader      = s.zzReader;
    zzEndRead     = s.zzEndRead;
    zzStartRead   = s.zzStartRead;
    zzCurrentPos  = s.zzCurrentPos;
    zzMarkedPos   = s.zzMarkedPos;
    zzAtBOL       = s.zzAtBOL;
    zzAtEOF       = s.zzAtEOF;
    zzEOFDone     = s.zzEOFDone;
    zzFinalHighSurrogate = s.zzFinalHighSurrogate;
    yyline        = s.yyline;
    yychar        = s.yychar;
    yycolumn      = s.yycolumn;
  }


  /**
   * Returns true iff there are still streams left
   * to read from on the stream stack.
   */
