  /**
   * Resumes scanning until the next regular expression is matched,
   * the end of input is encountered or an I/O-Error occurs.
   *
   * @return      the next token
   * @exception   java.io.IOException  if any I/O-Error occurs
   */
  override fun next_token(): Symbol?
  {
    var zzInput: Int = 0;
    var zzAction: Int = 0;

    var zzTransL: IntArray = ZZ_TRANS;
    var zzRowMapL: IntArray = ZZ_ROWMAP;
    var zzAttrL: IntArray = ZZ_ATTRIBUTE;

    while (true) {
      // cached fields:
      var zzCurrentPosL = 0
      var zzMarkedPosL: Int = zzMarkedPos;
      var zzEndReadL: Int = zzEndRead;
      var zzBufferL: CharArray = zzBuffer;

      var zzR: Boolean = false;
      var zzCh: Int;
      var zzCharCount: Int = 0
      zzCurrentPosL = zzStartRead
      while (zzCurrentPosL + zzCharCount < zzMarkedPosL) {
        zzCurrentPosL += zzCharCount
        zzCh = Character.codePointAt(zzBufferL, zzCurrentPosL, zzMarkedPosL);
        zzCharCount = Character.charCount(zzCh);
        when (zzCh.toChar()) {
         '\u000B', '\u000C', '\u0085', '\u2028', '\u2029' -> {
          yyline++;
          yycolumn = 0;
          zzR = false;
          }
         '\r' -> {
          yyline++;
          yycolumn = 0;
          zzR = true;
          }
         '\n' -> {
          if (zzR)
            zzR = false;
          else {
            yyline++;
